        text: "\n\n米开朗琪罗、多纳泰罗、莱昂纳多和拉斐尔将回归大银幕，与爱普尔·奥尼尔、弗恩·芬威克和一位全新的角色－－曲棍球蒙面侠凯西·琼斯一起对付更强大、更邪恶的坏蛋。超级坏蛋施莱德在越狱之后加入了由疯狂科学家苍蝇博士和他两位手下猪面人和犀牛头组成的邪恶团体，企图用他们的邪恶计划统治世界。忍者神龟们正准备对付施莱德和他的新同伙，却发现一位同样想统治世界，但更加邪恶的对手——臭名昭著的朗格。\n\n54G\n\n"
